/* eslint-disable no-use-before-define */
import React from 'react'
import TextField from '@material-ui/core/TextField'
import Grid from '@material-ui/core/Grid'
import Autocomplete from '@material-ui/lab/Autocomplete'

function InputAuto ({ Datas, Icon, Key, Label, Event, Name }) {
    return (
        <div style={{ width: 300 }}>
            <Autocomplete
                freeSolo
                onChange={(event, newValue) => newValue && Event(newValue)}
                onSelect={(event) => event && Event(event)}
                id="free-solo-2-demo"
                disableClearable
                options={Datas && Datas.map((option) => option[Key])}
                renderInput={(params) => (
                    <Grid container spacing={1} alignItems="flex-end">
                        <Grid item>
                            <Icon />
                        </Grid>
                        <Grid item>
                            <TextField
                                {...params}
                                label={Label}
                                error={false}
                                // value={ville}
                                // className="max-width"
                                name={Name}
                                style={{ width: 215 }}
                                InputProps={{ ...params.InputProps, type: 'search' }}
                            />
                        </Grid>
                    </Grid>
                )}
            />
        </div>
    )
}

export default InputAuto
